import React from 'react';
import uniqid from "uniqid";
import {Component} from 'react';

const EducationInfo = (props) => {
  const { titles } = props;
  return (
    <ul>
       {props.titles.map((title) => {

        return <li key={uniqid()}> <div className="title" > <a>{title.from}-{title.to} {title.titleName}, {title.school} 
        {"\n"} <span id={titles.indexOf(title)} onClick={props.deleteTitle}>x</span> </a> 
        <a>{title.moreInfo}</a> 
     </div>   
        </li>;

      })}
    </ul>
  );
};

export default EducationInfo;
